B.y3=new A.bh("Google Play Store","App discoverability","### Google Play Store has been replaced with Aurora Store, an Open Source alternative that includes Device Spoofing(emulating Google certification).\n### Google Play Services have been replaced with microG(Open Source Google Apps).\n### FDroid(Open Source App Store that does not rely on Google Play Store) is also included.")
